import React from "react";
import "../bulma/css/bulma.min.css";
import "../App.css";
import { useEffect } from "react";
import { useState } from "react";
import Convert from "convert-svg-react";
//import { SvgXml } from "react-native-svg";

function TrustedLeadingBrandsAPI() {
  const [data, setData] = useState([]);

  const apiGet = () => {
    fetch("http://127.0.0.1:5000/api_get_trusted_leading_brands")
      .then((respose) => respose.json())
      .then((json) => {
        console.log(json);
        setData(json);
      });
  };

  useEffect(() => {
    apiGet();
  }, []);

  const myData = data;
  const listItems = myData.map((myList) => (
    <li>dangerouslySetInnerHTML={{ __html: myList.brand_image_tb01 }}</li>
  ));

  return (
    <div>
      <h2>React Map Example</h2>
      <div>{listItems}</div>
    </div>
  );

  /*
  return (
    <div>
      <div>
        MY API
        <br />
      </div>
      <div>
        {data.map((item) => (
          <div>
            <Convert string={item.brand_image_tb01} />
          </div>
        ))}
      </div>
      <div></div>
    </div>
  );*/
}

export default TrustedLeadingBrandsAPI;

